css:
/*
* Browser
*/
.quick-query-browser.no-buttons #quick-query-connections {
  top: 0;
}
.quick-query-browser.no-buttons > .btn-group {
  display: none;
}
.quick-query-browser > .btn-group {
  display: block;
}
.quick-query-browser ol#quick-query-connections {
  overflow: auto;
  contain: size;
  z-index: 2;
  -webkit-user-select: none;
  display: flex;
  flex-direction: column;
  margin: 0;
  padding-left: 5px;
  padding-right: 10px;
  height: auto;
  position: absolute;
  top: 27px;
  bottom: 0;
  left: 0;
  right: 0;
}
.quick-query-browser ol#quick-query-connections .selected:before {
  background: #222;
}
.quick-query-browser ol#quick-query-connections:focus .selected:before {
  background: #4182C4;
}
.quick-query-browser .list-tree li.list-nested-item.quick-query-database.default > .list-item.header {
  font-weight: bold;
}
.quick-query-browser .list-tree li.list-nested-item.quick-query-connection.default > .list-item.header {
  font-weight: bold;
}
